import React from "react";
import Logo from "../../../components/Logo";
import { Link } from "react-scroll";

const Navbar = () => {
  return (
    <nav className="bg-gray-700 my-5 mx-10 px-6 py-2 rounded-lg flex items-center justify-between">
      <Logo />
      <div>
        <Link to="Home" smooth={true} duration={500} spy={true} activeClass="active">
          Home
        </Link>
        <Link to="why" smooth={true} duration={500} spy={true} activeClass="active">
          Why Kode?
        </Link>
        <Link to="kody" smooth={true} duration={500} spy={true} activeClass="active">
          Meet Kody
        </Link>
        <Link to="works" smooth={true} duration={500} spy={true} activeClass="active">
          How it works?
        </Link>
        <Link to="pricing" smooth={true} duration={500} spy={true} activeClass="active">
          Pricing
        </Link>
        <Link to="contact" smooth={true} duration={500} spy={true} activeClass="active">
          Contact Us
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
